"use strict";
const InputNode = require("../core/InputNode.js");
const THREE = require("three");
class Vector3Node extends InputNode {
  constructor(value = new THREE.Vector3()) {
    super("vec3");
    this.value = value;
    Object.defineProperty(this, "isVector3Node", { value: true });
  }
}
module.exports = Vector3Node;
